    false,nt"url": null,nt"notes": "This narrative report for Crab Orchard
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1958. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, prescribed
    burning, and wildfires. Resource management is outlined; topics include grazing,
    haying, and timber removal. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, and violations.
    Items of interest, N-R forms, and photographs are attached.",nt"license_title":
